import * as echarts from 'echarts';

function HistogramChartBase(chartData) {
  let max = 100,
    chartData1 = [];
  if (chartData && chartData.data) {
    max = Math.ceil(Math.max(...chartData.data) * 1.1);
    chartData.data.map(() => {
      chartData1.push(max);
    });
  }
  return {
    tooltip: {
      trigger: 'item',
      textStyle: {
        color: '#b9b9ba',
      },
      borderColor: 'rgba(74,72,72)',
      backgroundColor: 'rgba(14,48,45,0.9)',
      padding: [7, 10],
      formatter: '{b0}:{c0}',
    },
    grid: {
      top: '10%',
      right: '5%',
      left: '5%',
      bottom: '10%',
      containLabel: true,
    },
    xAxis: {
      type: 'value',
      boundaryGap: [0, 0.01],
      splitLine: {
        show: false,
      },
      axisTick: {
        alignWithLabel: 'auto',
      },
      axisLabel: {
        color: '#B9B9BA',
        fontSize: 12,
        margin: 0,
      },
    },
    yAxis: {
      type: 'category',
      data: [
        'USA',
        'India',
        'China',
        'World',
        'ABC',
        'EDF',
        'Brazil',
        'Indonesia',
      ],
      axisTick: {
        show: false,
      },
      axisLine: {
        show: false,
      },
      axisLabel: {
        color: '#B9B9BA',
        fontSize: 12,
      },
    },
    series: [
      {
        type: 'pictorialBar',
        symbol:
          'image://data:image/png;base64,',
        symbolRepeat: false,
        symbolMargin: 0,
        symbolClip: true,
        symbolSize: [444, 7],
        symbolBoundingData: 444,
        symbolPosition: 'start',
        symbolOffset: 0,
        data: chartData.data,
        z: 2,
      },
      {
        type: 'pictorialBar',
        label: {
          show: false,
        },
        animationDuration: 0,
        symbolRepeat: false,
        symbolMargin: 0,
        symbol:
          'image://data:image/png;base64,',
        symbolSize: [444, 7],
        symbolBoundingData: 444,
        symbolPosition: 'start',
        symbolOffset: 0,
        data: chartData1,
        z: 1,
      },
    ],
  };
}

